    "Electrochemical Capacitor Development for Pulsed Power Communications Project",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:18:45.694358",nt"name": "electrochemical-capacitor-development-for-pulsed-power-communications-project-4cd36",nt"isopen":
    true,nt"url": null,nt"notes": "In this NASA Phase II SBIR Project, we will
    continue the development of graphitic nanosheets (GNS) for electrochemical capacitor
    (EC) electrode materials. In the Phase I project, treatments of the electrode materials
    resulted in increases of relative capacitance (2x), relative energy (4x), and relative
    power (25&#37;). These results surpassed those of commercially available ECs for
    relative power and will fulfill NASA's need for energy storage materials for communications
    and navigation.rntWe will address the following in the Phase II program: (1) Increase
    performance through exfoliation, activation, and other surface treatments; (2) Use
    these materials as supports for the deposition of pseudocapacitive species to form
    a nanocomposite electrode; (3) Improve the test cell fabrication to decrease equivalent
    series resistance (ESR) and passive layer formation; (4) Purify electrode materials
    and electrolyte to decrease leakage current and self-discharge; (5) Perform environmental
    testing including temperature, pressure, and vibration; (6) Fabricate, test, and
    deliver functional prototype cells to NASA at the end of the Phase II project. This
    technology is currently at a TRL of 3-4 and we expect to achieve a TRL of 5 with
    delivery of prototype cells to NASA for testing.rn",nt"license_title": "U.S.
